import React from 'react';
import { TopNavBar } from './TopNavBar';
import logo from './nba-logoman-word-white.svg';
import './App.css';

function App() {
  return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
        </header>
      </div>
  );
}

export default App;
